import * as React from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";

const RestsTable = ({ rests }: any) => {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell align="left">Chef Name</TableCell>
            <TableCell align="left">Picture</TableCell>
            <TableCell align="left">Dishes</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rests.map((rest: any, index: number) => (
            <TableRow
              key={index}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {rest.name}
              </TableCell>
              <TableCell align="left">{rest.chefName}</TableCell>
              <TableCell align="left">{rest.pic}</TableCell>
              <TableCell align="left">{rest.dishes}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default RestsTable;
